@James_M_South @stevejgordon I really mean it.
In C++ you can have a variable holding a disposable that gets freed up when you leave the scope - this has been missing in C#.
I like that a lot - most times you don't need to create an explicit scope via an arbitrary construct just to handle disposable pattern

C# 8 introduces null-coalescing assignments with the ??= operator

now instead of:
claims = claims ?? Enumerable.Empty&lt;string&gt;();

you can write:
claims ??= Enumerable.Empty&lt;string&gt;();

